package LC859;

import org.junit.jupiter.api.Assertions;
import org.junit.jupiter.api.DisplayName;
import org.junit.jupiter.api.Test;

public class BuddyStringsTest {

    BuddyStrings obj = new BuddyStrings();


    @Test
    @DisplayName("Example 2: Input : s = \"ab\", goal = \"ba\"")
    void example2(){
        Assertions.assertTrue( obj.buddyStrings("ab","ba"));
    }

    @Test
    @DisplayName("Example 1: Input :  s = \"ab\", goal = \"ab\"")
    void example1(){
        Assertions.assertFalse( obj.buddyStrings("ab","ab"));
    }

    @Test
    @DisplayName("Example 3: Input : s = \"aa\", goal = \"aa\"")
    void example3(){
        Assertions.assertTrue( obj.buddyStrings("aa","aa"));
    }

    @Test
    @DisplayName("Example 5: Input : s = \"abab\", goal = \"abab\"")
    void example5(){
        Assertions.assertTrue( obj.buddyStrings("abab","abab"));
    }



    @Test
    @DisplayName("Example 5: LONG")
    void example6(){
        Assertions.assertTrue( obj.buddyStrings("",""));
    }

}
